INSERT INTO `diadiem` VALUES ('14A','Ký túc xá sinh viên 14A.','','#'),('14B','Ký túc xá sinh viên 14B.','','#'),('14C','Ký túc xá sinh viên 14C.','','#'),('A1','Nhà hiệu bộ ĐH Ngoại Ngữ.','','#'),('A2','Giảng đường A2 - ĐH Ngoại Ngữ.','','#'),('A3','Khoa sau đại học - ĐH Ngoại Ngữ.','','#'),('A4','Khoa phương Đông, phương Tây ĐH Ngoại Ngữ.','','#'),('A5','Nhà khách ĐH Ngoại Ngữ.','','#'),('A6','Trường THPT Chuyên Ngoại Ngữ.','','#'),('A7','Nhà đa năng A7.','Nhà đa năng rộng rãi với đầy đủ các thiết bị, dụng cụ cho các môn học thể chất.','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('B1','Khoa quản trị kinh doanh.','','#'),('B2','Giảng đường B2.','','#'),('B3','Giảng đường B3.','','#'),('B4','Trung tâm hỗ trợ sinh viên.','','#'),('Bánh mỳ UB','Bánh mỳ UB','','#'),('C1','Giảng đường C1.','','#'),('C1T','Trung tâm thư viện và tri thức số.','Thư viện Đại học Quốc gia có 7 tầng rộng rãi, thoải mái, mát mẻ, hoạt động các ngày trong tuần (trừ thứ bảy và chủ nhật).','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('C2','Giảng đường C2.','','#'),('C3','Giảng đường C3.','','#'),('C4','Văn phòng khoa Pháp - ĐH Ngoại Ngữ.','','#'),('C5','TT Công nghệ thông tin ĐH Ngoại Ngữ.','','#'),('C6','Hội trường Vũ Đình Liên.','','#'),('Cafe Sách ','Cafe Sách ','','#'),('Cổng chính ĐHQGHN','Cổng chính ĐHQGHN','Đây là Đại học Quốc gia Hà Nội!','https://www.facebook.com/media/set/?set=a.2252544914780927&type=3'),('Cổng chưa biết','Cổng chưa biết','','#'),('Cổng Chùa Thánh Chúa','Cổng Chùa Thánh Chúa','','#'),('Cổng KTX NN','Cổng KTX NN','Nằm ở vị trí đắc địa trong khuôn viên của Đại học Quốc gia Hà Nội. Ký túc xá Ngoại ngữ ưu tiên cho các bạn sinh viên Công nghệ, khoa Luật, Ngoại ngữ, Kinh tế...','https://www.facebook.com/TVTS.UET.VNU/photos/a.2247336405301778/2247336591968426'),('Cổng phụ ĐHSP','Cổng phụ ĐHSP','','#'),('Cổng sau ĐHQGHN','Cổng sau ĐHQGHN','','#'),('Cổng ĐHNN','Cổng ĐHNN','','#'),('Cổng ĐHSP','Cổng ĐHSP','','#'),('D1','Hội trường Nguyễn Văn Đạo.','','#'),('D2','Nhà điều hành ĐHQGHN.','','#'),('E1','Khoa Luật.','','#'),('E2','Viện vi sinh vật & công nghệ sinh học trường ĐH Công Nghệ & viện công nghệ thông tin.','','#'),('E3','Viện vi sinh vật & công nghệ sinh học trường ĐH Công Nghệ & viện công nghệ thông tin.','“Tòa nhà điều hành” của riêng trường Đại học Công nghệ.','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('E4','Trường ĐH Kinh Tế.','','#'),('E5','Giảng đường E5.','','#'),('G2','Giảng đường G2.','Vừa là giảng đường vừa có trung tâm máy tính lại có cả văn phòng khoa Cơ học kỹ thuật và tự động hóa…..','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('G3','Giảng đường G3.','Giảng đường nằm đối diện với khoa Luật, bên ngoài G3 là những quán ăn nhanh lúc nào cũng đông đúc sinh viên.','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('G4','Nhà xuất bản, nhà in. <br>TT nghiên cứu về phụ nữ. <br>TT hỗ trợ đào tạo & phát triển đô thị đại học.','','#'),('G5','Giảng đường G5. <br>TT phát triển ĐHQGHN.','','#'),('G6','Giảng đường G6.','','#'),('G7','Khoa sau đại học, ĐH giáo dục, TT đào tạo & bồi dưỡng giảng viên lý luận chính trị.','','#'),('G8','Khoa Quốc Tế. <br>TT phát triển hệ thống.','','#'),('GĐ2','Giảng đường 2. <br>Nhà ăn sinh viên.','Giảng đường GĐ2 có rất nhiều phòng học thông minh, trang bị đầy đủ các thiết bị như điều hòa, máy chiếu, bàn học đẹp, ...','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('GĐ3','Giảng đường 3','Giảng đường GĐ3 là nơi đặt trụ sở của Văn phòng chất lượng cao (CLC) Đại học Công nghệ. Khu giảng đường có diện tích 1300m2 gồm 15 phòng học có sức chứa từ 40-60 chỗ ngồi, đáp ứng quy mô 700 sinh viên/ca học.','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('Hiệu sách ĐHQG','Hiệu sách ĐHQG','','#'),('Rubic 8','Rubic 8','','#'),('Sân VĐ ĐHNN','Cung liên hợp thể thao Đại học Ngoại ngữ','Đây là sân bóng “chất” và sân tập thể dục đầy đủ tiện nghi. Có nhà đa năng, sân bóng rổ, bóng chuyền, cầu lông, tennis, bóng bàn…','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('Sunwah','Sunwah','','#'),('Thiên đường ẩm thực','Thiên đường ẩm thực','','#'),('Vườn nhãn trước G2','Vườn nhãn trước G2','Nơi đây chính là cái “tổ” lí tưởng để họp mặt Câu lạc bộ, tổ chức trò chơi, tập văn nghệ, ...','https://www.facebook.com/media/set/?set=a.2239256642776421&type=3'),('Y1','ĐH Y Dược.','','#');
